import styles from "../assets/Shows.module.css";
import commonStyles from "../assets/common.module.css";

function SpecificShow(month, day, city, place, price, ticketsLink) {
  return (
    <div className={commonStyles.specificElement}>
      <h2 className={styles.month}>Novembre</h2>
      <div className={styles.showInfo}>
        <h2 className={styles.showDay}>12</h2>
        <div className={styles.concretInfo}>
          <h3>Berga</h3>
          <h4>Pavelló municipal d'esports</h4>
          <h4>Preu: 5€ anticipada</h4>
          <a href="https://google.com" target="_blank" rel="noreferrer">
            Comprar entrades
          </a>
        </div>
      </div>
    </div>
  );
}

export default SpecificShow;
